import com.eviware.soapui.support.XmlHolder

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def ResponseMessage = testRunner.testCase.testSuite.getPropertyValue( "json" ) 
def holder = groovyUtils.getXmlHolder( ResponseMessage )

testRunner.testCase.testSuite.setPropertyValue( "weight", "15.00" )


for( earTag in holder.getNodeValues( "//officialEarTag" ))
{

	date = new Date().plus(-1).format( 'yyyy-MM-dd')
	time = new Date().format( 'HH:mm:ss')
    	testRunner.testCase.testSuite.setPropertyValue( "officialEarTag", earTag )
	def testStep = testRunner.testCase.getTestStepByName("milkVisits")
	testStep.run(testRunner, context).sleep(3000)
	def datetime = date +"T" + time + "+01:00"
	testRunner.testCase.testSuite.setPropertyValue( "timeFlag", datetime )
	log.info ("OfficialEarTag: " +earTag + " Timestamp: " +datetime)

}

